commits.content:
.productsSection {
    width: 798px;
    background-color: #fff;
    box-sizing: border-box;
    padding: 38px 63px;
    padding-bottom: 57px;
}
.linksSection a {
    font-family: 'foundry-boldita';
    font-weight: 800;
    color: #2B1A51;
    text-decoration: underline;
}
.linksSection, .linkSection{ display: flex; }
.linkSection.tooltip { margin: 0; }
.productsGrid {
    margin-top: 41px;
    display: grid;
    grid-template-columns: repeat(3, 206px);
    column-gap: 26px;
    row-gap: 26px;
}
.productItem {
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    height: 187px;
    background-color: #ECEBEE;
    background: url("../public/images/productBackground.svg");
    box-sizing: border-box;
    padding: 11px 40px 26px 31px;
}
.itemTitle {
    font-family: 'gilroy';
    font-size: 17px;
    line-height: 23.8px;
    color: #2B1A51;
    margin-bottom: 19px;
}
.productImg { height: 65px; }
